  \"Double Bag VARTM for High Temperature Composites Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T01:00:28.893872\",\n\t\"name\": \"double-bag-vartm-for-high-temperature-composites-project-b07d5\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The process known as double bag vacuum assisted
  resin transfer molding (DBVARTM) was developed by NASA to help deplete by products.
  \ To date, the NASA DBVARTM process has reduced void content to approximately four
  to five percent.  This number has fallen short of the goal of two percent.  During
  the Phase I effort, San Diego Composites (SDC) was able to reduce the void content
  to 0.8 percent to 1.5 percent.   rnThere are three primary technical objectives
  to the Phase II effort.  The first objective is to perform a trade study to evaluate
  and optimize the effect of stitched performs.  Stitching has had a large effect
  on the void content in the laminate and several different stitching variables will
  be evaluated.  The second objective is to transition the work done in Phase I to
  larger components.  These components will consist of larger plates and structures
  will be evaluated using non destructive testing along with mechanical testing.  At
  the end of the Phase II effort, a full scale component will be fabricated, evaluated
  using non destructive testing, and then the component will be tested. The final
  objective is to transition the technology to Boeing Phantom Works.  This objective
  will demonstrate that the process developed in a laboratory can be reproduced at
  any facility.  By the end of the Phase II program, the Technology Readiness Level
  (TRL) is expected to be 5-6.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
